import React from "react";
import NutritionLabel from "../../NutritionLabel/NutritionLabel";
import Styles from "./RecipieModal.module.css";
import Button from "../../UI/Button/Button";

const recipieModal = (props) => (
    <>
        <i className={`fas fa-times ${Styles.CloseIcon}`} onClick={props.closeIconClicked}></i>
        <div className={Styles.Name}>Save Recipie</div>
        <div><input type="text" placeholder="Recipie Name"/></div>
        <NutritionLabel product={props.recipie}/>
        <div>
            <Button classname="Success">Save Recipie</Button>
            <Button classname="Danger">Cancel</Button>
        </div>

    </> 
)

export default recipieModal;
